use aula;

DROP TABLE stage_cliente;

create table stage_cliente (
	cd_stage INT auto_increment PRIMARY KEY,
    nm_cliente VARCHAR(150),
	dt_nascimento DATE,
	nr_cpf VARCHAR(150),
	ds_fone VARCHAR(150),
	nm_logradouro VARCHAR(150),
	tp_logradouro VARCHAR(150),
	nm_bairro VARCHAR(150)
) DEFAULT charset=utf8;

